import React from 'react';
import './Main.css';

import{EditPost} from 'EditPost'
import {Posts} from '../Posts/Posts'

import {Route} from 'react-router-dom'


function Main() {
  return (
    <div className="Main">

      {/*<Route path='/' component ={Posts} />*/}
      <Route path='/addPosts' component={EditPost}/>
       
    </div>
  );
}

export default Main;
